const NavBar = () => {
    return  (
        <nav>
            <ul>
                <li>
                    <Link to="/"> Projects </Link>
                </li>
                <li>
                    <Link to="/deleted"> Recently Deleted</Link>
                </li>
            </ul>
        </nav>
    );  
};

export default NavBar
